import React from "react";
import { View, Text } from "react-native";

const Favorites = () => {
  return (
    <View style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Text>Favorites Screen</Text>
    </View>
  );
};

export default Favorites;
